#!/bin/sh
#











# Type 'sh install.sh' in a terminal to unpack a clean
# exercise file and the encrypted sample solutions.












GENERATED_ON='Tue 15 Nov 23:34:01 GMT 2016'
GENERATED_ON_MACHINE='cca-ug04-13013'
set -e

if [ ! $QUIET ]; then
	echo "This script will now prepare your directory to use our encrypted sample"
	echo "solutions in directory Bram/ ."
	echo
	echo "All files in this directory will be overwritten."
	echo
	echo "Furthermore, if you don't have a Scrabble.hs or Sowpods.hs yet, we"
	echo "will create an initial version."
	echo
fi


if which uudecode 2> /dev/null ; then
    true # fine
else
    mkdir -p Bram
    mkdir -p Bram/uudecode

    cat <<EOD > Bram/uudecode/uudecode
#!/usr/bin/env python2

import uu, sys, os, os.path



of = open('Bram/uudecode/input', 'wb')
of.write(sys.stdin.read()) # already in binary mode, hopefully
of.close()

iff = open('Bram/uudecode/input', 'r')
firstline = iff.readline()
_, _, filename = firstline.split(' ', 2)
if os.path.exists(filename.rstrip()):
    os.unlink(filename.rstrip())

uu.decode('Bram/uudecode/input', quiet=True)
EOD
    chmod a+x Bram/uudecode/uudecode

    export PATH=$(pwd)/Bram/uudecode:$PATH
fi


